function Evenements({ Data }) {
  let total = 0;
  return (
    <>
      {Data.map(function (user, i) {
        return (
          <>
            <div className="my-10 bg-blue-400">
              <ul className="py-6 list-outside list-disc pl-5">
              </ul>
            </div>
          </>
        );
      })}
    </>
  );
}

export default Evenements;
